import React, { useEffect, useState } from 'react';
import AlumniList from '../components/AlumniList'; 
import { fetchAlumni } from '../services/api'; // Import your API function

const AlumniPage = () => {
    const [alumniList, setAlumniList] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        const loadAlumni = async () => {
            try {
                const alumniData = await fetchAlumni(); 
                setAlumniList(alumniData);
                setLoading(false);
            } catch (error) {
                setError('Failed to fetch alumni data.');
                setLoading(false);
            }
        };

        loadAlumni();
    }, []);

    if (loading) return <p>Loading alumni...</p>;
    if (error) return <p>{error}</p>;

    return (
        <div>
            <h1>Alumni List</h1>
            {alumniList.length > 0 ? (
                <AlumniList alumniList={alumniList} />
            ) : (
                <p>No alumni found.</p>
            )}
        </div>
    );
};

export default AlumniPage;
